def load_prepared_data(model_type='university', data_dir='./prepared_data'):
    """
    –ó–∞–≥—Ä—É–∑–∫–∞ –ø–æ–¥–≥–æ—Ç–æ–≤–ª–µ–Ω–Ω—ã—Ö –¥–∞–Ω–Ω—ã—Ö
    """
    data_path = f'{data_dir}/{model_type}_data.pkl'

    if not os.path.exists(data_path):
        raise FileNotFoundError(f"–§–∞–π–ª {data_path} –Ω–µ –Ω–∞–π–¥–µ–Ω. –°–Ω–∞—á–∞–ª–∞ –∑–∞–ø—É—Å—Ç–∏—Ç–µ –ø–æ–¥–≥–æ—Ç–æ–≤–∫—É –¥–∞–Ω–Ω—ã—Ö.")

    with open(data_path, 'rb') as f:
        data = pickle.load(f)

    return (data['X_train'], data['X_test'], data['y_train'],
            data['y_test'], data['scaler'], data['feature_names'])





@st.cache_resource
def load_program_model_components(models_dir='./models', data_dir='./prepared_data'):
    """
    –ó–∞–≥—Ä—É–∂–∞–µ—Ç –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –¥–ª—è –º–æ–¥–µ–ª–∏ –ø—Ä–æ–≥–Ω–æ–∑–∏—Ä–æ–≤–∞–Ω–∏—è —Å–ø—Ä–æ—Å–∞ –Ω–∞ –ü–†–û–ì–†–ê–ú–ú–´.
    """
    components = {}
    try:
        # –ó–∞–≥—Ä—É–∑–∫–∞ –º–æ–¥–µ–ª–∏
        model_path = os.path.join(models_dir, 'best_tuned_program_model.keras')
        if not os.path.exists(model_path):
            raise FileNotFoundError(f"–ú–æ–¥–µ–ª—å –¥–ª—è –ø—Ä–æ–≥—Ä–∞–º–º –Ω–µ –Ω–∞–π–¥–µ–Ω–∞: {model_path}")
        components['model'] = keras.models.load_model(model_path)

        # –ó–∞–≥—Ä—É–∑–∫–∞ —Å–∫–∞–ª–µ—Ä–∞
        scaler_path = os.path.join(models_dir, "scaler_program.pkl")
        if not os.path.exists(scaler_path):
            raise FileNotFoundError(f"–°–∫–∞–ª–µ—Ä –¥–ª—è –ø—Ä–æ–≥—Ä–∞–º–º –Ω–µ –Ω–∞–π–¥–µ–Ω: {scaler_path}")
        with open(scaler_path, 'rb') as f:
            components['scaler'] = pickle.load(f)

        # –ó–∞–≥—Ä—É–∑–∫–∞ –∫–æ–¥–∏—Ä–æ–≤—â–∏–∫–∞ –¥–ª—è —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–æ–≤
        encoder_path = os.path.join('./data', 'university_label_encoder.pkl')
        if not os.path.exists(encoder_path):
            raise FileNotFoundError(f"–ö–æ–¥–∏—Ä–æ–≤—â–∏–∫ –¥–ª—è —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–æ–≤ –Ω–µ –Ω–∞–π–¥–µ–Ω: {encoder_path}")
        components['university_encoder'] = joblib.load(encoder_path)

        st.success("–ö–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –¥–ª—è –º–æ–¥–µ–ª–∏ –ø—Ä–æ–≥—Ä–∞–º–º —É—Å–ø–µ—à–Ω–æ –∑–∞–≥—Ä—É–∂–µ–Ω—ã.")
        return components
    except Exception as e:
        st.error(f"–ö—Ä–∏—Ç–∏—á–µ—Å–∫–∞—è –æ—à–∏–±–∫–∞ –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–æ–≤ –º–æ–¥–µ–ª–∏ –ø—Ä–æ–≥—Ä–∞–º–º: {e}")
        return None


@st.cache_resource  # –ö—ç—à–∏—Ä—É–µ–º —Ä–µ—Å—É—Ä—Å—ã –¥–ª—è –±—ã—Å—Ç—Ä–æ–π –∑–∞–≥—Ä—É–∑–∫–∏
def load_prediction_components(models_dir='./models', data_dir='./prepared_data'):
    """
    –ó–∞–≥—Ä—É–∂–∞–µ—Ç –º–æ–¥–µ–ª—å, —Å–∫–∞–ª–µ—Ä –∏ —Å–ø–∏—Å–æ–∫ –ø—Ä–∏–∑–Ω–∞–∫–æ–≤ –≤ –ü–†–û–°–¢–û–ô –°–õ–û–í–ê–†–¨.
    """
    components = {}
    try:
        # 1. –ó–∞–≥—Ä—É–∑–∫–∞ Keras –º–æ–¥–µ–ª–∏
        model_path = os.path.join(models_dir, 'university_demand_model.keras')
        if not os.path.exists(model_path):
            raise FileNotFoundError(f"–ú–æ–¥–µ–ª—å –Ω–µ –Ω–∞–π–¥–µ–Ω–∞: {model_path}")
        components['model'] = keras.models.load_model(model_path) # –ö–ª—é—á: 'model'

        # 2. –ó–∞–≥—Ä—É–∑–∫–∞ —Å–∫–∞–ª–µ—Ä–∞ –∏ —Å–ø–∏—Å–∫–∞ –ø—Ä–∏–∑–Ω–∞–∫–æ–≤ –∏–∑ PKL —Ñ–∞–π–ª–∞
        data_path = os.path.join(data_dir, 'university_data.pkl')
        if not os.path.exists(data_path):
            raise FileNotFoundError(f"–§–∞–π–ª –¥–∞–Ω–Ω—ã—Ö 'university_data.pkl' –Ω–µ –Ω–∞–π–¥–µ–Ω: {data_path}")

        with open(data_path, 'rb') as f:
            data = pickle.load(f)

        # –ü–†–Ø–ú–û–ï –ü–†–ò–°–í–ê–ò–í–ê–ù–ò–ï –ö–õ–Æ–ß–ï–ô
        components['scaler'] = data.get('scaler') # –ö–ª—é—á: 'scaler'
        components['feature_names'] = data.get('feature_names') # –ö–ª—é—á: 'feature_names'

        # –ü—Ä–æ–≤–µ—Ä–∫–∞, —á—Ç–æ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –¥–µ–π—Å—Ç–≤–∏—Ç–µ–ª—å–Ω–æ –∑–∞–≥—Ä—É–∑–∏–ª–∏—Å—å
        if components['scaler'] is None or components['feature_names'] is None:
            raise ValueError("`scaler` –∏–ª–∏ `feature_names` –æ—Ç—Å—É—Ç—Å—Ç–≤—É—é—Ç –≤ —Ñ–∞–π–ª–µ `university_data.pkl`")

        st.success("–ö–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –¥–ª—è –ø—Ä–æ–≥–Ω–æ–∑–∏—Ä–æ–≤–∞–Ω–∏—è —É—Å–ø–µ—à–Ω–æ –∑–∞–≥—Ä—É–∂–µ–Ω—ã.")
        return components

    except Exception as e:
        st.error(f"–ö—Ä–∏—Ç–∏—á–µ—Å–∫–∞—è –æ—à–∏–±–∫–∞ –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–æ–≤: {e}")
        return None

def prepare_program_features(common_inputs_from_widgets, university_id, university_name, program_name, is_debug_target):
    """
    –°–æ–∑–¥–∞–µ—Ç –ø–æ–ª–Ω—ã–π —Å–ª–æ–≤–∞—Ä—å –ø—Ä–∏–∑–Ω–∞–∫–æ–≤ –¥–ª—è –º–æ–¥–µ–ª–∏ –ø—Ä–æ–≥–Ω–æ–∑–∏—Ä–æ–≤–∞–Ω–∏—è —Å–ø—Ä–æ—Å–∞ –Ω–∞ –ø—Ä–æ–≥—Ä–∞–º–º—É.

    Args:
        common_inputs_from_widgets (dict): –°–ª–æ–≤–∞—Ä—å —Å –æ–±—â–∏–º–∏ –ø—Ä–∏–∑–Ω–∞–∫–∞–º–∏ –∏–∑ –≤–∏–¥–∂–µ—Ç–æ–≤.
        university_id (int): ID –≤—ã–±—Ä–∞–Ω–Ω–æ–≥–æ —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞.
        university_name (str): –ù–∞–∑–≤–∞–Ω–∏–µ –≤—ã–±—Ä–∞–Ω–Ω–æ–≥–æ —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞.
        program_name (str): –ù–∞–∑–≤–∞–Ω–∏–µ –≤—ã–±—Ä–∞–Ω–Ω–æ–π –ø—Ä–æ–≥—Ä–∞–º–º—ã.

    Returns:
        dict: –ü–æ–ª–Ω—ã–π —Å–ª–æ–≤–∞—Ä—å –ø—Ä–∏–∑–Ω–∞–∫–æ–≤, –≥–æ—Ç–æ–≤—ã–π –¥–ª—è predict_program_demand_streamlit.
    """
    # –ó–∞–¥–∞–µ–º –ø–æ–ª–Ω—ã–π –Ω–∞–±–æ—Ä –ø—Ä–∏–∑–Ω–∞–∫–æ–≤ —Å–æ –∑–Ω–∞—á–µ–Ω–∏—è–º–∏ –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é ("–∑–∞–≥–ª—É—à–∫–∞–º–∏")
    # –≠—Ç–∏ –∑–Ω–∞—á–µ–Ω–∏—è –¥–æ–ª–∂–Ω—ã –±—ã—Ç—å —Ç–∏–ø–∏—á–Ω—ã–º–∏ "—Å—ã—Ä—ã–º–∏" –∑–Ω–∞—á–µ–Ω–∏—è–º–∏
    default_features =  {
        "year": 2025,
        "avg_ege_paid": 59.55295746666265,
        "ege_change_prev_year": 0.25466421841606207,
        "enrolled_paid": 38.741970440384094,
        "cost_of_education_rub": 200.3236446825803,
        "avg_ege_budget": 74.5354354173565,
        "enrolled_budget": 53.28801059570753,
        "gdp_per_capita_usd": 9.858285722886126,
        "gdp_usd_billion": 1.7783387014237981,
        "gdp_rub_billion": 30.091806387525963,
        "inflation_rate_percent": 5.8332717257156625,
        "mrot_rub": 13.324083862617018,
        "avg_salary_rub": 52.117248126185245,
        "real_salary_growth_percent": 4.467448300773607,
        "cpi_index": 200.4461184190723,
        "base_cpi": 100.4491857559977,
        "base_inflation_percent": 5.917807410974986,
        "gdp_deflator": 121.35555010384996,
        "population_million": 146.61882243159448,
        "unemployment_rate_percent": 4.536531109840162,
        "total_enrolled": 92.02998103609163,
        "enrolled_paid_university": 597.41904217212,
        "all_enrolled_paid": 184876.60639354624,
        }
    # 2. –ù–∞—á–∏–Ω–∞–µ–º —Å –∑–Ω–∞—á–µ–Ω–∏–π –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é
    features = default_features.copy()

    # 3. –û–±–Ω–æ–≤–ª—è–µ–º —Å–ª–æ–≤–∞—Ä—å –∑–Ω–∞—á–µ–Ω–∏—è–º–∏, –∫–æ—Ç–æ—Ä—ã–µ –≤–≤–µ–ª –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å
    features.update(common_inputs_from_widgets)

    # 4. –î–æ–±–∞–≤–ª—è–µ–º –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –≤—É–∑–µ –∏ –ø—Ä–æ–≥—Ä–∞–º–º–µ
    features['university'] = university_id
    features['university_text'] = university_name
    features['selected_program'] = program_name  # –î–æ–±–∞–≤–ª—è–µ–º –¥–ª—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –≤–Ω—É—Ç—Ä–∏ predict_...

    # 5. –î–æ–±–∞–≤–ª—è–µ–º one-hot encoded –ø—Ä–∏–∑–Ω–∞–∫–∏ –¥–ª—è –ø—Ä–æ–≥—Ä–∞–º–º
    # –°–Ω–∞—á–∞–ª–∞ –≤—Å–µ OHE-–ø—Ä–∏–∑–Ω–∞–∫–∏ —Ä–∞–≤–Ω—ã 0
    all_program_columns = [f'program_group_{p}' for p_list in program_groups.values() for p in p_list]
    unique_program_columns = sorted(list(set(all_program_columns)))  # –£–Ω–∏–∫–∞–ª—å–Ω—ã–µ –∏ –æ—Ç—Å–æ—Ä—Ç–∏—Ä–æ–≤–∞–Ω–Ω—ã–µ

    for col in unique_program_columns:
        features[col] = 0

    # –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º 1 –¥–ª—è –≤—ã–±—Ä–∞–Ω–Ω–æ–π –ø—Ä–æ–≥—Ä–∞–º–º—ã
    selected_program_col = f"program_group_{program_name}"
    if selected_program_col in features:
        features[selected_program_col] = 1

    if is_debug_target:
        with st.expander(f"üïµÔ∏è‚Äç‚ôÇÔ∏è –û—Ç–ª–∞–¥–∫–∞ –ø—Ä–∏–∑–Ω–∞–∫–æ–≤ –¥–ª—è –í–´–ë–†–ê–ù–ù–û–ô –ø—Ä–æ–≥—Ä–∞–º–º—ã: '{program_name}'"):
            st.json(features)

    return features


def prepare_features_for_prediction(features_dict, feature_names, scaler=None):
    """
    –ì–æ—Ç–æ–≤–∏—Ç –ø—Ä–∏–∑–Ω–∞–∫–∏ –¥–ª—è –ü–ï–†–í–û–ô –º–æ–¥–µ–ª–∏ (—Å–ø—Ä–æ—Å –Ω–∞ —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç).
    """
    if scaler is None:
        print("–û–®–ò–ë–ö–ê: –°–∫–µ–π–ª–µ—Ä –Ω–µ –ø–µ—Ä–µ–¥–∞–Ω –≤ prepare_features_for_prediction.")
        return pd.DataFrame()

    # –ó–∞–¥–∞–µ–º –∑–Ω–∞—á–µ–Ω–∏—è –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é –¥–ª—è –ø–µ—Ä–≤–æ–π –º–æ–¥–µ–ª–∏
    default_features = {
        "year": 2025,
        "avg_ege_paid": 59.55295746666265,
        "ege_change_prev_year": 0.25466421841606207,
        "enrolled_paid": 38.741970440384094,
        "cost_of_education_rub": 200.3236446825803,
        "avg_ege_budget": 74.5354354173565,
        "enrolled_budget": 53.28801059570753,
        "gdp_per_capita_usd": 9.858285722886126,
        "gdp_usd_billion": 1.7783387014237981,
        "gdp_rub_billion": 30.091806387525963,
        "inflation_rate_percent": 5.8332717257156625,
        "mrot_rub": 13.324083862617018,
        "avg_salary_rub": 52.117248126185245,
        "real_salary_growth_percent": 4.467448300773607,
        "cpi_index": 200.4461184190723,
        "base_cpi": 100.4491857559977,
        "base_inflation_percent": 5.917807410974986,
        "gdp_deflator": 121.35555010384996,
        "population_million": 146.61882243159448,
        "unemployment_rate_percent": 4.536531109840162,
        "total_enrolled": 92.02998103609163,
        "enrolled_paid_university": 597.41904217212,
        "all_enrolled_paid": 184876.60639354624,
    }

    final_features = default_features.copy()
    final_features.update(features_dict)

    features_df = pd.DataFrame([final_features])
    features_df = features_df[feature_names]

    try:
        # –£ –ø–µ—Ä–≤–æ–π –º–æ–¥–µ–ª–∏ –Ω–µ—Ç OHE, –ø–æ—ç—Ç–æ–º—É –º–∞—Å—à—Ç–∞–±–∏—Ä—É–µ–º –≤—Å–µ, –∫—Ä–æ–º–µ 'university'
        cols_to_scale = [col for col in feature_names if col != 'university']

        if not set(cols_to_scale).issubset(features_df.columns):
            missing = set(cols_to_scale) - set(features_df.columns)
            raise ValueError(f"–í DataFrame –æ—Ç—Å—É—Ç—Å—Ç–≤—É—é—Ç —Å—Ç–æ–ª–±—Ü—ã, –Ω–µ–æ–±—Ö–æ–¥–∏–º—ã–µ –¥–ª—è —Å–∫–∞–ª–µ—Ä–∞: {missing}")

        transformed_data = scaler.transform(features_df[cols_to_scale])
        features_df[cols_to_scale] = transformed_data

        return features_df

    except Exception as e:
        print(f"–ö–†–ò–¢–ò–ß–ï–°–ö–ê–Ø –û–®–ò–ë–ö–ê –ù–ê –≠–¢–ê–ü–ï –ú–ê–°–®–¢–ê–ë–ò–†–û–í–ê–ù–ò–Ø (–º–æ–¥–µ–ª—å —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞): {e}")
        return pd.DataFrame()

def predict_program_demand_streamlit(user_inputs, program_components, is_debug_target):
    """
    –ü–æ–¥–≥–æ—Ç–∞–≤–ª–∏–≤–∞–µ—Ç –¥–∞–Ω–Ω—ã–µ –∏ –ø—Ä–µ–¥—Å–∫–∞–∑—ã–≤–∞–µ—Ç —Å–ø—Ä–æ—Å –Ω–∞ –ø—Ä–æ–≥—Ä–∞–º–º—É (–¥–ª—è Streamlit)
    """
    if not program_components:
        st.warning("–ö–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –º–æ–¥–µ–ª–∏ –ø—Ä–æ–≥—Ä–∞–º–º –Ω–µ –∑–∞–≥—Ä—É–∂–µ–Ω—ã.")
        return 0.0

    # –ò–∑–≤–ª–µ–∫–∞–µ–º –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã
    model = program_components['model']
    scaler = program_components['scaler']
    university_encoder = program_components['university_encoder']

    # 1. –ü–û–î–ì–û–¢–û–í–ö–ê –ß–ò–°–õ–û–í–´–• –ü–†–ò–ó–ù–ê–ö–û–í (numeric_input)
    numeric_features = [
        'year', 'avg_ege_paid', 'ege_change_prev_year', 'enrolled_paid',
        'cost_of_education_rub', 'avg_ege_budget', 'enrolled_budget',
        'gdp_per_capita_usd', 'gdp_usd_billion', 'gdp_rub_billion',
        'inflation_rate_percent', 'mrot_rub', 'avg_salary_rub',
        'real_salary_growth_percent', 'cpi_index', 'base_cpi',
        'base_inflation_percent', 'gdp_deflator', 'population_million',
        'unemployment_rate_percent', 'total_enrolled', 'enrolled_paid_university',
        'all_enrolled_paid'
    ]
    df_numeric = pd.DataFrame([user_inputs])
    for col in numeric_features:
        if col not in df_numeric.columns:
            df_numeric[col] = 0

    df_numeric = df_numeric[numeric_features]
    X_numeric_scaled = scaler.transform(df_numeric)

    # 2. –ü–û–î–ì–û–¢–û–í–ö–ê –ü–†–ò–ó–ù–ê–ö–û–í –ü–†–û–ì–†–ê–ú–ú (program_groups_input)

    # g–æ–ª—É—á–∞–µ–º —Ñ–æ—Ä–º—É –≤—Ö–æ–¥–æ–≤ –∏–∑ —Å–∞–º–æ–π –º–æ–¥–µ–ª–∏. –≠—Ç–æ —Å–ø–∏—Å–æ–∫ –∫–æ—Ä—Ç–µ–∂–µ–π.
    # model.input_shape -> [(None, 23), (None, 67), (None, 1)]
    # –Ω—É–∂–µ–Ω –≤—Ç–æ—Ä–æ–π —ç–ª–µ–º–µ–Ω—Ç (–∏–Ω–¥–µ–∫—Å 1) –∏ –µ–≥–æ –≤—Ç–æ—Ä–∞—è —Ä–∞–∑–º–µ—Ä–Ω–æ—Å—Ç—å (–∏–Ω–¥–µ–∫—Å 1).
    try:
        expected_program_features = model.input_shape[1][1]
    except (IndexError, TypeError):
        st.warning("–ù–µ —É–¥–∞–ª–æ—Å—å –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏ –æ–ø—Ä–µ–¥–µ–ª–∏—Ç—å —Ä–∞–∑–º–µ—Ä–Ω–æ—Å—Ç—å –ø—Ä–æ–≥—Ä–∞–º–º. –ò—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –∑–Ω–∞—á–µ–Ω–∏–µ –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é (67).")
        expected_program_features = 67

    X_programs = np.zeros((1, expected_program_features))

    # –ø–æ–ª—É—á–∞–µ–º –ø–æ–ª–Ω—ã–π —Å–ø–∏—Å–æ–∫ –∏–º–µ–Ω —Å—Ç–æ–ª–±—Ü–æ–≤ –¥–ª—è one-hot encoding –ø—Ä–æ–≥—Ä–∞–º–º
    #program_feature_names = [f'program_group_{p}' for p in program_groups.get(user_inputs.get('university', 0), [])]

    #selected_program_col = f"program_group_{user_inputs.get('selected_program', '')}"

    # –ù–∞—Ö–æ–¥–∏–º –∏–Ω–¥–µ–∫—Å –≤—ã–±—Ä–∞–Ω–Ω–æ–π –ø—Ä–æ–≥—Ä–∞–º–º—ã –≤ —Å–ø–∏—Å–∫–µ –í–°–ï–• –≤–æ–∑–º–æ–∂–Ω—ã—Ö –ø—Ä–æ–≥—Ä–∞–º–º –º–æ–¥–µ–ª–∏
    try:
        # –ø–æ–Ω–∞–¥–æ–±–∏—Ç—Å—è –ø–æ–ª–Ω—ã–π —Å–ø–∏—Å–æ–∫ program_features, –∫–æ—Ç–æ—Ä—ã–π –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–ª—Å—è –ø—Ä–∏ –æ–±—É—á–µ–Ω–∏–∏.
        # –ø—Ä–µ–¥–ø–æ–ª–æ–∂–∏–º, —á—Ç–æ –æ–Ω –µ—Å—Ç—å.
        # –ú—ã –ø—Ä–µ–¥–ø–æ–ª–∞–≥–∞–µ–º, —á—Ç–æ –ø–æ—Ä—è–¥–æ–∫ –≤ program_groups —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É–µ—Ç OHE.
        available_programs_for_uni = program_groups.get(user_inputs.get('university', 0), [])
        if user_inputs.get('selected_program') in available_programs_for_uni:
            prog_index = available_programs_for_uni.index(user_inputs.get('selected_program'))
            if prog_index < expected_program_features:
                X_programs[0, prog_index] = 1

    except (ValueError, IndexError):
        # –ï—Å–ª–∏ —á—Ç–æ-—Ç–æ –ø–æ—à–ª–æ –Ω–µ —Ç–∞–∫, –ø—Ä–æ—Å—Ç–æ –æ—Å—Ç–∞–≤–ª—è–µ–º –Ω—É–ª–µ–≤–æ–π –≤–µ–∫—Ç–æ—Ä
        pass

    # 3. –ü–û–î–ì–û–¢–û–í–ö–ê ID –£–ù–ò–í–ï–†–°–ò–¢–ï–¢–ê (university_input)
    university_name = user_inputs.get('university_text', '')
    try:
        if university_name and university_name in university_encoder.classes_:
            X_university = university_encoder.transform([university_name])
        else:
            X_university = np.array([0])
    except:
        X_university = np.array([0])

    if is_debug_target:
        with st.expander("–û—Ç–ª–∞–¥–∫–∞ –≤—Ö–æ–¥–æ–≤ –≤ –º–æ–¥–µ–ª—å (–¥–ª—è –í–´–ë–†–ê–ù–ù–û–ô –ø—Ä–æ–≥—Ä–∞–º–º—ã)"):
            st.write(f"**–§–æ—Ä–º–∞ `numeric_input`**: `{X_numeric_scaled.shape}`")
            st.write(f"**–§–æ—Ä–º–∞ `program_groups_input`**: `{X_programs.shape}`")
            st.write(f"**–§–æ—Ä–º–∞ `university_input`**: `{X_university.reshape(-1, 1).shape}`")
            st.write(f"**–ó–Ω–∞—á–µ–Ω–∏–µ `university_input`**: `{X_university[0]}` (–¥–ª—è –≤—É–∑–∞: '{university_name}')")
            st.write(f"**–ò–Ω–¥–µ–∫—Å –∞–∫—Ç–∏–≤–Ω–æ–π –ø—Ä–æ–≥—Ä–∞–º–º—ã**: `{np.argmax(X_programs) if np.sum(X_programs) > 0 else '–ù–µ—Ç'}`")

    # 4. –ü–†–ï–î–°–ö–ê–ó–ê–ù–ò–ï
    model_inputs = {
        'numeric_input': X_numeric_scaled,
        'program_groups_input': X_programs,
        'university_input': X_university.reshape(-1, 1)
    }

    try:
        prediction = model.predict(model_inputs, verbose=0)[0, 0]
        print(f"Program predict :{prediction}")
        return max(0.0, float(prediction))
    except Exception as e:
        st.error(f"–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø—Ä–µ–¥—Å–∫–∞–∑–∞–Ω–∏–∏ —Å–ø—Ä–æ—Å–∞ –Ω–∞ –ø—Ä–æ–≥—Ä–∞–º–º—É: {e}")
        return 0.0



def predict_demand_share(user_inputs, components):
    """
    –ü—Ä–µ–¥—Å–∫–∞–∑—ã–≤–∞–µ—Ç –î–û–õ–Æ —Å–ø—Ä–æ—Å–∞, –∏—Å–ø–æ–ª—å–∑—É—è –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –∏–∑ –ü–†–û–°–¢–û–ì–û –°–õ–û–í–ê–†–Ø.
    """
    # –ø—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞–ª–∏—á–∏—è –≤—Å–µ—Ö –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–æ–≤
    if not all(k in components for k in ['model', 'scaler', 'feature_names']):
        st.error("–ö–æ–º–ø–æ–Ω–µ–Ω—Ç—ã –º–æ–¥–µ–ª–∏ –∑–∞–≥—Ä—É–∂–µ–Ω—ã –Ω–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ –∏–ª–∏ –æ—Ç—Å—É—Ç—Å—Ç–≤—É—é—Ç.")
        st.write("–°–æ–¥–µ—Ä–∂–∏–º–æ–µ 'components':", components)  # –î–ª—è –æ—Ç–ª–∞–¥–∫–∏
        return 0.0

    # –ü—Ä—è–º–æ–µ –∏–∑–≤–ª–µ—á–µ–Ω–∏–µ
    model = components['model']
    feature_names = components['feature_names']
    scaler = components['scaler']

    try:
        # –ü–æ–¥–≥–æ—Ç–æ–≤–∫–∞ –ø–æ–ª–Ω–æ–≥–æ –Ω–∞–±–æ—Ä–∞ –ø—Ä–∏–∑–Ω–∞–∫–æ–≤
        features_prepared = prepare_features_for_prediction(user_inputs, feature_names, scaler)

        # –ü—Ä–µ–¥—Å–∫–∞–∑–∞–Ω–∏–µ
        prediction = model.predict(features_prepared, verbose=0)[0, 0]

        return max(0.0, min(1.0, float(prediction)))
    except Exception as e:
        st.error(f"–û—à–∏–±–∫–∞ –≤–æ –≤—Ä–µ–º—è –ø—Ä–µ–¥—Å–∫–∞–∑–∞–Ω–∏—è: {e}")
        return 0.0


